import React from 'react';
import images from "../Utilities/ImageDirectories/CampusWatchImages.json"
import Profile from './Profile';
import ReverseProfile from './ReverseProfile';

function Page() {
  return (
    <div className="min-h-screen flex flex-col">
      <header className="bg-gray-200 py-4 px-8">
        <h1 className="text-3xl font-bold">OUTREACHES DONE BY THE MINISTRY</h1>
      </header>
      <Profile title={"Gospel Football Tournament 2024"} imagesrc={"images/Carousel_Images/FootballTournamentPhotos/PXP-1291.jpg"} text={"The Gospel Football Tornament came about as a result of Evan"} attachement={"tournament"}/>
      <ReverseProfile title={"God's Alternative to Bloodshed 2013"} imagesrc={"images/campuswatch/20240817_123919.jpg"} text={"A vision From the Lord About Plateau State Triggered A Prayer Work on the 19th of April 2013"}/>
    </div>
  );
}

export default Page;
